const TodoLis = () => {
    const [todoList, setTodoList] = useState([])

    const addTodu = () => {
        setTodoList([...todoList, setTodoList])

    }
    console.log(todoList);

    return (
        <div>
            <input type="text"   onChange={(e) => setTodoList(e.target.value)} />
            <button onClick={addTodu} >click</button>
        </div>
    )

}

export default TodoLis;
